      var nameStr="";
      for(var c=0; c<this.numCards; c++) {
        nameStr += this.cards[c].getName() + ",";}
      alert(this.numCards + " cards: "+nameStr);
    },

    init: function() {
      for (var c=0; c<this.numCards; c=c+1) {
        this.cards[c]=makeCard(c);
      }
    },

    getCard: function(n) {
      if (n>=1 && n<=this.numCards) { 
        return this.cards[n-1];
      } 
      return null;
    },

    size: function() { return this.numCards; },
  };

  deck.init();
