         if neighbor live then count++
       if even(count) then cell <- 0
                      else cell <- 1
       plot cell
       input go
       goto S
  */
  var ON=1, OFF=0;
  var gen=[], ngen=[];
  var nr=500, nc=500;
  for (var r=0; r<nr; r++) {
    gen[r]=[]; ngen[r]=[];
    for (var c=0; c<nc; c++) {
      gen[r][c] = OFF;
      ngen[r][c] = OFF;
    }
  }

  // initial config

  gen[250][250] = ON; gen[250][255] = ON; gen[250][260] = ON;
  gen[255][250] = ON; gen[255][255] = ON; gen[255][260] = ON;
  gen[260][250] = ON; gen[260][255] = ON; gen[260][260] = ON;

  var ct;

  for (var num=0; num<88; num++) {

  for (var r=1; r<nr-1; r++) {
    for (var c=1; c<nc-1; c++) {
      ct = 0;
      if (gen[r-1][c]===ON) { ct++; }
      if (gen[r+1][c]===ON) { ct++; }
      if (gen[r][c-1]===ON) { ct++; }
      if (gen[r][c+1]===ON) { ct++; }
      if (isEven(ct)) { ngen[r][c] = OFF; } else { ngen[r][c] = ON; }
    }
  }

  for (var r=1; r<nr-1; r++) {
    for (var c=1; c<nc-1; c++) { 
      gen[r][c] = ngen[r][c]; 
    }
  }

  }

