  webPage = makeHTMLCanvas(); //alert(webPage);
  PIC = getCanvasContext();  

  for (var r=1; r<nr-1; r++) {
    for (var c=1; c<nc-1; c++) { 
      gen[r][c] = ngen[r][c]; 
      if (gen[r][c]===ON) { putPoint(r,c,PIC); }
    }
  }

  return;
}

